import styled from "styled-components";
import palette from "../utils/styles";

const HeaderBorder = styled.div`
  background-color: ${palette.green[5]};
  color: white;
  width: 100%;
  display: flex;
`;

const HeaderFont = styled.p`
  font-size: 20px;
  margin: 20px;
  color: white;
`;

export { HeaderBorder, HeaderFont };
